export default function Player(props) {
  return (
    <article className="playerProfile">
      <div className="img-Container">
        <img className="main_image" src={props.imgSrc} alt={props.imgAlt} />

        <button onClick={() => props.onButtonClick(props.id)}>
          {props.title}
        </button>
      </div>
    </article>
  );
}
